void writ(char strg[], char color[])
{
    int i;

    if (color)
        fprintf(yyout, "<span style='color: %s'>", color);
        
    for (i = 0; strg[i]; ++i)
	if (strg[i] == '\n')
	    fprintf(yyout, "<br />");
	else if (strg[i] == ' ')
	    fprintf(yyout, "&nbsp;");
	else if (strg[i] == '\t')
	    fprintf(yyout, "&nbsp;&nbsp;&nbsp;&nbsp;");
	else if (strg[i] == '<')
	    fprintf(yyout, "&lt;");
	else if (strg[i] == '>')
	    fprintf(yyout, "&gt;");
	else
	    fprintf(yyout, "%c", strg[i]);

    if (color)
	fprintf(yyout, "</span>");
}

